    false,nt"url": null,nt"notes": "The cropland program on Big Stone NWR will
    be accomplished each year with a combination of: (1) force account farming of permanent
    farm units where there is no cooperative farming interest, (2) long-term cooperative
    farming agreements on permanent farm units where there is cooperative farming interest.
    Permanent farm units shown in figure 1 are to be maintained. Crops remaining over
    winter from a combination of the above will provide a minimum means of meeting standing
